import React, { Component } from "react";
import { Shaders, Node, GLSL } from "gl-react";
import { Surface } from "gl-react-dom";

export default class Slide extends Component {
  render() {
    return (
      <Surface
        width={500}
        height={400}
        onMouseMove={this.onMouseMove}
      ></Surface>
    );
  }
}
